css:
@-moz-document domain("youtube.com") {
/* New */
  #logo-container .logo, .footer-logo-icon,
  #logo-icon-container {
    background-image: url(https://image.jimcdn.com/app/cms/image/transf/dimension=83x10000:format=png/path/s42cb6e5cc3a32b98/image/i573f40b5f54d7e22/version/1534982241/image.png) !important;
    background-size: auto !important;
    background-position: center center !important;
    background-repeat: no-repeat !important;
 }
  
/* New Dark */
  [dark] #logo-icon-container {
    background-image: url(https://image.jimcdn.com/app/cms/image/transf/dimension=83x10000:format=png/path/s42cb6e5cc3a32b98/image/i37b39701e8706b04/version/1534982406/image.png) !important;
  }
  #logo-icon-container > *,
  .ytp-chrome-controls .ytp-right-controls a.ytp-youtube-button > * ,
  #player .ytp-watermark > * {
    display: none !important;
  }
}
